import React from 'react';

const AchievementCard = ({ value, description }) => (
  <div className="flex flex-col justify-center items-center bg-[#FFF6F3] p h-[156px] w-[156px] md:w-[240px] md:h-[240px] rounded-full justify-self-center overflow-hidden">
    <div className="flex flex-row justify-center items-center">
      <p className="font-bold text-3xl sm:text-4xl lg:text-5xl leading-9 text-primary ml-2">{value}</p>
    </div>
    <p className="font-medium text-base sm:text-lg leading-6 mt-3 md:mt-6 text-center">{description}</p>
  </div>
);

const Statestic = () => {
  return (
    <div>
      <section className="flex flex-col mt-20">
       
        <div className="mt-10 grid grid-cols-2 lg:grid-cols-4 gap-y-5 lg:gap-y-0 gap-x-5 place-items-center w-full mx-auto max-w-7xl px-5">
          <AchievementCard value="75K+" description="Expert Chat & Call Minutes" />
          <AchievementCard value="4.9" description="Average Expert Rating" />
          <AchievementCard value="8900+" description="Sessions Completed" />
          <AchievementCard value="1.5M+" description="App Downloads" />
        </div>
      </section>
    </div>
  );
}

export default Statestic;
